    };

    const Logout = () => {};

    return (
        <div className="App">
            <StyledEngineProvider injectFirst>
                <BrowserRouter>
                    <Routes>
                        <Route path="/" element={<Dashboard />} />
                        <Route exact path="/login" component={() => <Login login={Login} error={error} />} />
                        <Route path="*" element={<PageNotFound />} />
                    </Routes>
                </BrowserRouter>
            </StyledEngineProvider>
        </div>
    );
};

export default App;
